(()=>{function i(){async function a(){try{let e=await fetch("/dashboard/link-previews/stats");if(!e.ok){console.error("Failed to fetch link preview statistics");return}let t=await e.json();if(t.length===0){console.log("No link preview data available");return}new Chart(document.getElementById("linkpreviews-domain-chart").getContext("2d"),{type:"doughnut",data:{labels:t.map(n=>n.Domain),datasets:[{data:t.map(n=>n.TotalAccesses),borderWidth:1}]},options:{responsive:!0,plugins:{legend:{position:"right",labels:{font:{size:14,family:"Inter"}}}}}})}catch(e){console.error("Error loading link preview chart:",e)}}document.readyState==="loading"?document.addEventListener("DOMContentLoaded",a):a()}i();})();
